    public function deleteForm($id){
        $annual_report = AnnualReport::find($id);
        if($annual_report === null){
            return redirect('/home')->withError("Form not found.");
        }
        if($annual_report->delete()){
            return redirect()->back()->withSuccess("Form successfully deleted.");
        }else{
            return redirect()->back()->withSuccess("Problem in deleting form. Please try after sometime");
        }
    }
    
